import React from "react";
import "./Robotics.css";
function Robotics() {
  return (
    <div>
      <div className="">
        <div className="row Nav bg-primary">
          <div className="col-3 ml-4 mt-2">Teams</div>{" "}
          <div className="col-2 mt-2">Add</div>
          <div className="col-3 mt-2">Game</div>
          <div className="col-2 mt-2">Latest</div>
        </div>
      </div>
    </div>
  );
}

export default Robotics;
